import React from 'react'
import {
  StyleSheet,
  Text,
  View,
  Dimensions,
  TouchableOpacity,
  StatusBar,
} from 'react-native'
import TextTicker from 'react-native-text-ticker'
// import Sound from 'react-native-sound'
// const audiolist = [
//   {
//     title: 'play music',
//     isRequire: true,
//     url: require('../list/Saybu Swag - Gecələr(MP3_160K).mp3'),
//   },
// ]
const Player = () => {
  return (
    <View style={styles.container}>
      <View style={styles.flat}>
        <View style={styles.textarea}>
          <TextTicker
            style={styles.trackheader}
            duration={7000}
            repeatSpacer={50}
          >
            salamhci kbkjkkbcwk ejbjbdj
          </TextTicker>
        </View>
        <View style={styles.textarea1}>
          <TextTicker
            style={styles.trackname}
            duration={9000}
            repeatSpacer={50}
          >
            salamhci kbkjkkbcwk ejbjbdj
          </TextTicker>
        </View>
      </View>
      <View style={styles.CtrlBtns}>
        <View style={styles.playingBtns}></View>
      </View>
    </View>
  )
}
const dimensions = {
  width: Dimensions.get('window').width,
  height: Dimensions.get('window').height,
}
const styles = StyleSheet.create({
  container: {
    marginTop: StatusBar.currentHeight,
    backgroundColor: 'red',
    height: dimensions.height,
  },
  CtrlBtns: {
    width: dimensions.width,
    height: 100,
    backgroundColor: 'lightblue',
  },
  playingBtns: {
    width: '45%',
    height: '100%',
    backgroundColor: 'black',
    alignSelf: 'center',
  },

  trackheader: {
    textAlign: 'center',
    color: 'white',
    fontSize: 20,
  },
  textarea: {
    width: 170,
    alignSelf: 'center',
    top: 300,
  },
  textarea1: {
    width: 150,
    alignSelf: 'center',
    top: 300,
  },
  trackname: {
    textAlign: 'center',
    fontSize: 18,
    color: 'white',
    marginTop: 10,
  },
  flat: {
    width: 250,
    height: 600,
    backgroundColor: 'green',
    alignSelf: 'center',
    borderBottomLeftRadius: 100,
    borderBottomRightRadius: 100,
  },
})
export default Player
